import React, { useState } from 'react';
import axios from "axios"

function MainPage() {
    const [results, setResults] = useState([])

    const fetcher = async () => {
        axios.get("http://localhost:8080/")
            .then(res => {
                setResults(...results, res.data)
                console.log(res.data)
            }).catch(e => {
                console.log(e)
            })
    }

    fetcher()

    return (
        <div>
            <h1>Heeeey</h1>
            <p>{results}</p>
        </div>
    )
}

export default MainPage;
